import React from 'react'
import './aboutme.css';


function AboutMe() {
  return (
   <div>
        <h1 className="header">A brief history</h1>
        <div className='aboutme-container'>
            <h1>I'm a full-stack software engineer, I enjoy tackling complex problems. My main focus is on JavaScript/TypeScript, React, Node.js, and I also specialize in both NoSQL and SQL databases.</h1>
            <p>My daily playground? TypeScript/JavaScript, React, and Node.js. Recently, I work on a product called DeClustor, is an open-source cloud management B2B-focused platform that simplifies the deploying and monitoring of applications running on AWS ECS.</p>
            <p>Out of work you can catch me meditating through outdoor runs, fusing Thai-Italian fusion cuisine in kitchen lab, experimenting with AI-enhanced home automation, or shredding the slopes on my snowboard when winter comes.</p>

           <p>I am originally from Thailand</p>
           <p>I get things </p>
        </div>
    </div>
  )
}

export default AboutMe;
